import styled from "styled-components";

export const _App = styled.div`
    padding: 2rem;
    background: #fdfdfd;
    & > *{
        margin-bottom: 2rem
    }
`

export const _Component = styled.div`
    padding: 1.5rem;
    background: white;
    border-radius: 1.5rem;
`
